Upgradable Proxies can be upgraded by the owner or permissioned delegates. /** * @dev DSNP Identity Factory Interface for creating upgradable identities */
interface IIdentityUpgradableFactory { /** * @dev event to log the created proxy contract address */ event ProxyCreated(address addr); /** * @dev Logs updates to the suggested logic contract * @dev MUST BE emitted when the contract changes the suggested logic address * @param newLogic The new address */ event LogicUpdated(address newLogic); /** * @dev This may be upgradable by the owner of the factory * * @return The current logic contract suggested by this factory */ function getLogic() external view returns (address); /** * @dev Creates a new identity with the message sender as the owner * and will be pointed at the default logic address. * * @dev This MUST emit ProxyCreated with the address of the new proxy contract * @return The address of the newly created proxy contract */ function createUpgradableProxy() external returns (address); /** * @dev Creates a new identity with the message sender as the owner * @param logic The address to use for the logic contract * * @dev This MUST emit ProxyCreated with the address of the new proxy contract * @return The address of the newly created proxy contract */ function createUpgradableProxy(address logic) external returns (address); /** * @dev Creates a new identity with the ecrecover address as the owner * @param logic The logic address to use for identity creation * @param owner The initial owner's address of the new contract * * @dev This MUST emit ProxyCreated with the address of the new proxy contract * @return The address of the newly created proxy contract */ function createUpgradableProxyWithOwner(address logic, address owner) external returns (address);
}

